import React from 'react';
import { Link } from 'react-router-dom';
import FullCalendar from '@fullcalendar/react'; // FullCalendar 라이브러리 임포트
import dayGridPlugin from '@fullcalendar/daygrid'; // dayGridPlugin 임포트
import '../css/MycalPage.css'; // 이 페이지의 CSS 파일 임포트
import logoImage from '../logo.png'; // 로고 이미지 파일 임포트

function MycalPage() {
  return (
    <div className="mycalPage">
      <img src={logoImage} alt="Logo" className="myPageLogo" />
      <div className="myPageTitle">마이페이지</div>
      <div className="navButtons">
        <Link to="/my/watched" className="navButton">이미 본 영화</Link>
        <Link to="/my/wishlist" className="navButton">보고싶은 영화</Link>
        <Link to="/my/calendar" className="navButton active">MOVIELY 캘린더</Link>
      </div>
      <div className="calendar-container">
  <FullCalendar
    defaultView="dayGridMonth"
    plugins={[ dayGridPlugin ]}
    height="400px" // 달력 높이 자동 조정

  />
</div>
    </div>
  );
}

export default MycalPage;
